    print(&#34;买玫瑰&#34;)
    print(&#34;看电影&#34;)

elif holiday_name == &#34;平安夜&#34;:
    print(&#34;买苹果&#34;)
    print(&#34;吃大餐&#34;)

elif holiday_name == &#34;生日&#34;:
    print(&#34;送蛋糕&#34;)

else:
    print(&#34;今天不是情人节&#34;)
